import {Routes, Route, BrowserRouter} from "react-router-dom";
import Physical from "./pages/physical";



function App() {
  return (
    <BrowserRouter>
    <Routes>
      <Route path="/login" element={<Physical />}/>;
      <Route path="/intel" element={<Physical />}/>;
      <Route path="/physical" element={<Physical />}/>;
      <Route path="/physical" element={<Physical />}/>;
    </Routes>
    </BrowserRouter>
  )
}

export default App;
